import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import Header from '../estructura/Header'
import Footer from '../estructura/Footer'

const index = () => {
  return (
    <View>
      <Header />
      <Text>index</Text>
      <Footer />
    </View>
  )
}

export default index

const styles = StyleSheet.create({})
